import React from 'react'
import Appbar from '../surface/Appbar'
import uccplogo from '../assets/uccplogo.png';
import schlogo from '../assets/schlogo.png';

function Dashboard() {
  return (  
    <div>
      <Appbar/>
      <div style={{ display: 'flex', justifyContent: 'flex-start', alignItems: 'center', justifyItems: 'center' }}>
        <img src={schlogo} alt="" className='h-68 w-68' />
      </div>
      <div>
        <p className='text-400'>Welcome to</p>
        <h1>Cagayan de Oro Christian School - UCCP E-Portal</h1>
      </div>
    </div>
  )
}

export default Dashboard
